import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { render } from '@testing-library/react';

const App = () => {
	const [superheroes, setSuperHeroes] = useState(null);

	console.log('1');

	useEffect(() => {
		console.log('3')(async () => {
			console.log('3');
			const myHeroes = await axios.get('http://localhost:3001');
			console.log('4');

			setSuperHeroes(myHeroes);
		})();
	}, []);

	const renderHeroes = async () => {
		if (!superheroes) {
			return <div>loading...</div>;
		} else {
			console.log(superheroes);
			superheroes.map((hero) => {
				return (
					<ul>
						<li>{hero.superhero}</li>
						<li>{hero.alter_ego}</li>
					</ul>
				);
			});
		}
	};

	return <div>Hello World</div>;
};

export default App;
